INSERT INTO `tb_info` VALUES (001, '2013-03-06 09:36:00', 000002, 'SOBRE A EMPRESA', 'SOBRE A EMPRESA', '<p>\r\n	Estamos h&aacute; 20 anos no mercado com muita credibilidade, idoneidade, e qualidade dos nossos servi&ccedil;os. Temos a melhor linha de cr&eacute;dito para financiar o seu ve&iacute;culo.&nbsp;</p>\r\n', 'Ativo');
INSERT INTO `tb_info` VALUES (003, '2013-02-27 10:36:03', 000004, 'COMO FINANCIAR', 'COMO FINANCIAR', '<p>\r\n	Em breve, estaremos publicando dicas para os nossos clientes, visando adotar medidas para financiamentos economicamente mais vi&aacute;veis.</p>\r\n', 'Ativo');
