INSERT INTO `tb_news` VALUES (000002, '2012-09-07 18:51:26', 001, '2012-09-07', 'Testando loop noticias', 'news2_20120907185126.jpg', '<p>\r\n	<span style="background-color: rgba(255, 255, 255, 0.917969); ">Neste s&aacute;bado, dia 12, foram realizados no Camel&atilde;o de Palho&ccedil;a e de S&atilde;o Jos&eacute; os sorteios de 4 vales-compra de R$ 1.000,00 cada. Em 20 dias de promo&ccedil;&atilde;o, foram preenchidos mais de 30.000 cupons nas duas unidades. Segue a lista dos ganhadores:</span></p>\r\n<div style="background-color: rgba(255, 255, 255, 0.917969); ">\r\n	<h3>\r\n		Camel&atilde;o S&atilde;o Jos&eacute;:&nbsp;</h3>\r\n	<div>\r\n		Valdirene de F&aacute;tma Alves&nbsp;- R$ 1.000,00 em vales-compra;</div>\r\n	<div>\r\n		Tainara Ferreira da Silva&nbsp;-&nbsp;R$ 1.000,00 em vales-compra.</div>\r\n</div>\r\n<h3>\r\n	Camel&atilde;o Palho&ccedil;a:&nbsp;</h3>\r\n<div style="background-color: rgba(255, 255, 255, 0.917969); ">\r\n	Bruno O. Silva - R$ 1.000,00 em vales-compra;</div>\r\n<div style="background-color: rgba(255, 255, 255, 0.917969); ">\r\n	Nilton&nbsp;Grazziotin -&nbsp;R$ 1.000,00 em vales-compra.</div>\r\n', 'Ativo');
INSERT INTO `tb_news` VALUES (000003, '2012-09-07 18:52:02', 001, '2012-09-07', 'Testando largura das noticias na lista', 'news3_20120907185202.jpg', '<p>\r\n	No m&ecirc;s dos namorados, nosso cliente e ouvinte da R&aacute;dio Cidade FM ser&aacute; convidado a vir ao Camel&atilde;o para concorrer a brindes.&nbsp;O &ocirc;nibus da R&aacute;dio Cidade FM buscar&aacute; os ouvintes&nbsp;nos bairros previamente escolhidos com hor&aacute;rios marcados, sendo divulgados pela&nbsp;pr&oacute;pria r&aacute;dio um dia antes na determinada regi&atilde;o. Fique ligado na R&aacute;dio Cidade FM e saiba os dias que o &ocirc;nibus da Cidade estar&aacute; no seu bairro. Chegando ao Camel&atilde;o voc&ecirc; pode preencher os cupons, formando uma declara&ccedil;&atilde;o de amor com as palavras &quot;Amor&quot; e &quot;Camel&atilde;o&quot;. As tr&ecirc;s melhores frases levar&atilde;o vales-compras do Camel&atilde;o.</p>\r\n<div>\r\n	<p>\r\n		1&ordf; melhor frase: R$ 1.500,00 em vales-compra<br />\r\n		2&ordf; melhor frase: R$ 1.000,00 em vales-compra<br />\r\n		3&ordf; melhor frase: R$ 500,00 em vales-compra</p>\r\n	<p>\r\n		Boa sorte!</p>\r\n	<p>\r\n		<sub>Regulamento</sub></p>\r\n	<p>\r\n		<sub>1. Promo&ccedil;&atilde;o n&atilde;o vinculada a compra<br />\r\n		2. Fica expressamente proibida a participa&ccedil;&atilde;o na promo&ccedil;&atilde;o de lojistas e parentes, bem como de funcion&aacute;rios das lojas.<br />\r\n		3. Promo&ccedil;&atilde;o de car&aacute;ter recreativo e cultural.<br />\r\n		4. O cliente vai ao Camel&atilde;o de S&atilde;o Jos&eacute; ou de Palho&ccedil;a e preenche o cupom da promo&ccedil;&atilde;o com seus dados pessoais e cria um frase com as palavras &quot;Amor&quot; e &quot;Camel&atilde;o&quot;.<br />\r\n		5. As 3 melhores frases selecionadas pela R&aacute;dio Cidade FM ganhar&atilde;o respectivamente R$ 1.500,00, R$ 1.000,00 e R$ 500,00 em Vales-compra, totalizando R$ 3.000,00.<br />\r\n		6. In&iacute;cio da promo&ccedil;&atilde;o: 01/06/2012, com finaliza&ccedil;&atilde;o no dia da escolha das melhores frases, dia 30/06/2012 &agrave;s 18:00h no Camel&atilde;o de Palho&ccedil;a.<br />\r\n		7. Prazo de retirada do pr&ecirc;mio: 30 dias ap&oacute;s a finaliza&ccedil;&atilde;o da promo&ccedil;&atilde;o.<br />\r\n		8. Fica autorizado o uso dos dados dos participantes da promo&ccedil;&atilde;o para o mailing do Camel&atilde;o.</sub></p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', 'Ativo');
INSERT INTO `tb_news` VALUES (000004, '2012-09-07 18:53:44', 001, '2012-09-07', 'Testando paginacao de  noticias', 'news4_20120907185344.jpg', '<p>\r\n	Uma nova loja de langeries foi aberta no Camel&atilde;o de S&atilde;o Jos&eacute;. Com o nome &quot;Lincherry&quot;, a loja pretende trabalhar com langeries de variados modelos e tamanhos.</p>\r\n<p>\r\n	E para este m&ecirc;s de inaugura&ccedil;&atilde;o, a loja est&aacute; lan&ccedil;ando uma &oacute;tima promo&ccedil;&atilde;o. Ao comprar 3 pe&ccedil;as, voc&ecirc; leva a 4&ordf; pe&ccedil;a de gra&ccedil;a.</p>\r\n<p>\r\n	Loja: 73 -&nbsp;<a href="http://camelao.com.br/saojose/lojas/?id=265:lincherry" target="_blank">Lincherry</a>&nbsp;@ Camel&atilde;o S&atilde;o Jos&eacute;<br />\r\n	Facebook:&nbsp;<a href="https://www.facebook.com/lincherrybrasil">/lincherrybrasil</a></p>\r\n', 'Ativo');
